  input: '"TEXT","F3A","","With regard to your letter dated November 2, 2004, the
    disbursement to the National Republican Congressional Committee in July 2004 was
    incorrectly entered on the wrong line and has been corrected.  The disbursement
    was for a transfer of excess campaign funds and should have been reported on line
    21.  With regard to the PAC''s best efforts, Lewis for Congress Committee includes
    a request for the required donor information as required by federal law in every
    solicitation it does. If a contribution is received without it, a written request
    for the information is sent within 30 days, along with a pre-addressed and stamped
    return envelope. Any contributor information received as a result of the PAC''s
    best efforts is reported to the Commission either in an amended report or on the
    next report due."'
